    public readonly Scalar CIALAB94DistanceTo(IColor other)
    {
        (double L1, double a1, double b1) = ToCIELAB94();
        (double L2, double a2, double b2) = other.ToCIELAB94();

        double δL = L1 - L2;
        double δa = a1 - a2;
        double δb = b1 - b2;

        double c1 = Math.Sqrt(a1 * a1 + b1 *b1);
        double c2 = Math.Sqrt(a2 * a2 + b2 * b2);
        double δC = c1 - c2;
        double δH = δa * δa + δb * δb - δC * δC;

        δH = δH < 0 ? 0 : Math.Sqrt(δH);

        double sc = 1 + .045 * c1;
        double sh = 1 + .015 * c1;

        double δCkcsc = δC / sc;
        double δHkhsh = δH / sh;

        double i = δL * δL + δCkcsc * δCkcsc + δHkhsh * δHkhsh;

        return i < 0 ? 0 : Math.Sqrt(i);
    }

    public readonly (double H, double S, double L) ToHSL()
    {
        double a = Math.Min(Math.Min(Rf, Gf), Bf);
        double b = Math.Max(Math.Max(Rf, Gf), Bf);
        double δ = b - a;
        double l = (b + a) / 2;
        double h, s;

        if (δ < 1e-5)
            s = h = 0;
        else
        {
            s = δ / (l < .5 ? b + a : 2 - b - a);

            double δr = (b - Rf) / δ;
            double δg = (b - Gf) / δ;
            double δb = (b - Bf) / δ;

            h = Rf == b ? δb - δg :
                Gf == b ? 2 + δr - δb :
                          4 + δg - δr;

            h *= 60;

            if (h < 0)
                h += 360;

            h *= Math.PI / 180;
        }

        return (h, s, l);
    }

