    public static RGBAColor FromComplexWrapped(Complex c, double α)
    {
        Scalar l = c.Length;
        Scalar i = 1L << (int)Math.Log2(l);

        if (l < 1)
            return FromHSL(c.Argument, 1, l / 2, α);

        l %= i;
        l /= (long)i << 1;
        l *= 4 / 5d;
        l += 1 / 5d;

        return FromHSL(c.Argument, 1, l, α);
    }

